@FranciscoReveriano yes, resnet50 is typically used directly for classification tasks rather than object detection tasks, but you can also use it as a backbone for object detection, and the same holds true for the rest of the models in the family, like resnet101, resnext101, etc.

csresnext50-panet-spp.cfg is one of these that leverages resnext50 backbone, coupled with a PANet rather than an FPN (like yolov3).
<img width="674" alt="Screen Shot 2020-02-26 at 2 11 34 PM" src="https://user-images.githubusercontent.com/26833433/75392951-eb5de680-58a1-11ea-9f58-0ec589ff894d.png">


@tamasbalassa that's great that you got better results. Did you train with a recent copy of the repo? Can you plot your results.png for both of the architecures?

@FranciscoReveriano well resnet101 would be used for a backbone, just like the darknet53 backbone in yolov3. Basically an object detection network is just:

backbone + head

Where the backbones can be resnet50, resnet101, resnext50, darknet53, etc. and the heads can be FPN, PANet, NASNet, BiFPN etc.
